# Given string S and a dictionary of words words, find the number of words[i] that is a subsequence of S.
#
# Example :
# Input:
# S = "abcde"
# words = ["a", "bb", "acd", "ace"]
# Output: 3
# Explanation: There are three words in words that are a subsequence of S: "a", "acd", "ace".

from collections import defaultdict

class Solution(object):
    def numMatchingSubseq(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        """
        unique_words = defaultdict(int)
        for word in words:
            unique_words[word] += 1

        count = 0
        for word, value in unique_words.items():
            word_present = self.findIfPresent(S, word)
            if word_present:
                count += unique_words[word]
        return count


    def findIfPresent(self, S, word):
        char_dict = defaultdict(int)
        for character in word:
            char_dict[character] += 1

        end = 0
        count = len(char_dict)

        while end < len(S):
            current = S[end]
            end += 1

            if current in char_dict:
                char_dict[current] -= 1

                if char_dict[current] == 0:
                    count -= 1

            if count == 0:
                return True
        return False




